import './starwars.css';


const Starwars = () => {

    const [data, setData] = useState([]);

    const getStarWarsData = async () => {
        try {
            const res = await fetch('https://swapi.dev/api/people');
            const actualData = await res.json();
            console.log(actualData);
            setData(actualData);
        }

        catch (err) {
            console.log(err);

        }

    }



    useEffect(() => {
        getStarWarsData();
    }, []);

    return (
        <>
            <section>
                <h1>SWAPI</h1>
                <p>The Starwars Api </p>

